Thank you for your feed-back, we have done some data analysis and found that for 12 month a good amount of users would lock up;
YIELD App is focusing on long-term sustainability and the changes were made in order to make the ecosystem (and the YLD token) more sustainable (over the long run).
This said, as always, we really appreciate all your feed-back and always report back to the team, so thank you for that !
